from google.colab import drive
import pandas as pd

drive.mount('/content/drive')
file_path = '/content/drive/MyDrive/Home Assignment/Chicago Sexual Crime Data.csv'

crime_df = pd.read_csv(file_path)

"""**I did a data reliability check in the GCP, like:**

1.  Checking that all the reports are indeed from Chicago territory by checking the limit of longitude and latitude
2.   Make sure I don't have NULL values ​​in a more in-depth description of the offence, otherwise I won't know if they wrote sexual offence in the title but in practice it is an offence not relevant to the research question.

**UPDATES**: All reports were indeed from Chicago and NULL values were handeled.
"""

# create street column from 'block' column to find streets with a high rate
# of sexual offences
block_split = crime_df['block'].str.split(' ',n=1,  expand=True)

crime_df['block_number'] = block_split[0]
crime_df['street_info'] = block_split[1]

direction_street = crime_df['street_info'].str.split(' ',n=1,  expand=True)
crime_df['direction'] = direction_street[0]
crime_df['street'] = direction_street[1]

crime_df = crime_df.drop(columns=['street_info', 'block'])

# create month column - to analyze data over months
crime_df['date'] = pd.to_datetime(crime_df['date'])
crime_df['month'] = crime_df['date'].dt.month

# remove 'SCHOOL, PRIVATE, BUILDING' from data set
# (missed it in SQL query process):
crime_df = crime_df[crime_df['location_description'] != 'SCHOOL, PRIVATE, BUILDING']

# combining similar location_description to avoid plenty of locations:
# ~~~~ For example: sidewalk is similar to street

# ~~~~ Another examle:
# all vehicle from different kind (taxi, car, commercial vehicle , etc) are
# basicly vehicle that located in most cases at streets/parking lot/etc so it
# doesn't matter the type of the vehicle , it only matters that police patrol
#will be able to see if there is a problem in the vehicle.
# Therefore all recieved 'VEHICLE' category

crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'VEHICLE' if ('VEHICLE' in str(x) or 'TAXICAB' in str(x) or 'TRANSPORTATION' in str(x))  else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'COLLEGE/UNIVERSITY GROUNDS/RESIDENCE HALL' if 'UNIVERSITY' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'RESIDENCE - PORCH/HALL/STAIRWELL/YARD' if ('RESIDENCE ' in str(x) or 'DRIVEWAY' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'CTA PLATFORM/STATION' if str(x) == 'CTA STATION' else x)
crime_df['location_description'] = crime_df['location_description'].str.replace('CTA', '').str.strip(' ')
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'CTA PLATFORM/STATION' if 'PLATFORM' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'AIRPORT' if 'AIRPORT' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'WAREHOUSE/LOT/PARKING LOT' if 'PARKING' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'STREET' if ('ALLEY' in str(x) or 'SIDEWALK' in str(x) or 'BRIDGE' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'SCHOOL' if 'SCHOOL' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'HOSPITAL ' if 'HOSPITAL ' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'TRAIN' if 'TRAIN' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'RESIDENCE - PORCH/HALL/STAIRWELL/YARD' if 'CHA ' in str(x) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'STORE/BUSINESS' if ('RESTAURANT' in str(x) or 'OFFICE' in str(x) or 'BARBERSHOP' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'STORE/BUSINESS' if ('DEALERSHIP' in str(x) or 'BANK' in str(x) or 'LIBRARY' in str(x) or 'STORE' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'GAS STATION' if str(x) == 'CAR WASH' else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'NATURE' if ('FOREST' in str(x) or 'LAKEFRONT' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'WAREHOUSE/LOT/PARKING LOT' if ('VACANT' in str(x) or 'WAREHOUSE' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'GOVERNMENT/FEDERAL PROPERTY' if ('GOVERNMENT' in str(x) or 'FEDERAL' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'ABANDONED/CONSTRUCTION SITE' if ('ABANDONED' in str(x) or 'CONSTRUCTION' in str(x)) else x)
crime_df['location_description'] = crime_df['location_description'].apply(lambda x: 'UNKNOWN' if ('OTHER' in str(x) or str(x) == 'nan') else x)

# Code for checking if the "combining similar location_description" works :)
distinct_values = crime_df['location_description'].unique()
distinct_values

crime_df

# Save crime_df dataframe to csv to use in Tableau
